const app=()=>{
  const [mealData, setmealData] = useState();


}


const getMealData=()=>{
    fetch(
        'https://api.spoonacular.com/recipes/findByNutrients?minCarbs=10&maxCarbs=50&number=2&apiKey=a9b075e6656c45f587b86cba1c8c3789'
      )
        .then((response) => response.json())
        .then((data) => {
          setmealData(data)
        })
        .catch(() => {
          console.log("error");
        });
}

const Meal=()=>{
 
  return (
    <div>
      <h2>{mealData}</h2>
    </div>
  )
}
